import React from 'react';
import TweenOne from 'rc-tween-one';

function Transition({n}) {
    const styles = {
        width: '100%',
        height: '600vh',
        position: 'fixed',
        transform: 'translateY(0vh)',
        backgroundColor: n.cor1,
        opacity: 1,
        top: '10vh',
        zIndex: 9
    }
    const animation = {
        from: [
            {
                delay: 0,
                duration: 1000,
                opacity: 1,
                top: '100vh',
                height: '0vh',
                ease: "easeOutCubic",
                backgroundColor: n.cor1,
                y: '0',
                type: 'from'
            }
        ],
        to: [
            {
                delay: 2900,
                duration: 2500,
                opacity: 1,
                top: '-100vh',
                ease: "easeInOutExpo",
                height: '100vh',
                backgroundColor: n.cor2,
                y: '0',
                type: 'to'
            }
        ]
    };
    return (
        <TweenOne
                key="tweenOne"
                animation={[
                ...animation.from,
                ...animation.to
            ]}
                style={styles}/>
    )
}

export default Transition;
